import React, { Component } from "react";
import { Form, Container } from "react-bootstrap";
export default class Lugares extends Component {
    state = {}
    render() {
        return (
            <div>
                <Container>
                <Form.Control
                    type="text"
                    id="inputPassword5"
                    aria-describedby="passwordHelpBlock"/>
                </Container>

            </div>
        )
    }
}
